import React from 'react'
import CartItem from './CartItem'

function CartList(value) {
    const {cart} = value

    return (
        <div className="container">

            
                
{
                         cart.map( items =>{
                             return <CartItem key={items.id} items={items} value={value} ></CartItem>
                         })
                     }
            

        </div>
        
    )
}

export default CartList
